import {
  Container,
  Row,
  Col,
  BreadcrumbItem,
  Breadcrumb,
  Card,
  CardHeader,
  CardTitle,
  CardImg,
  CardBody,
  CardFooter,
  Button,
  Alert
} from "shards-react";
import SEO from "react-seo-component";
import Head from "next/head";

import PDFFile from "../../../common/PDFFile";
// Layout
import Layout from "../../../components/Layout";
import ResourcesLayout from "../../../resources-components/ResourcesLayout";

// Style for the onft icons
const liStyles = {
  display: "inline!important",
  paddingLeft: "50px"
};

const oLiStyles = {
  display: "inline"
};

const ulStyles = {
  listStyleType: "none",
  paddingTop: "15px"
};

import { BrowserView, MobileView } from "react-device-detect";

const ComputerScience = props => (
  <Layout>
    <SEO
      title={"Cape Computer Science Past Papers | CXC Spanish Online"}
      description={
        "Get the CAPE Computer Science past papers in PDF format for free, along with the offical past paper booklet."
      }
      pathname={""}
      siteLanguage={"en"}
      twitterUsername={"_rxheem"}
      author={"Raheem McDonald"}
      article={true}
      publishedDate={"Jan 13, 2020"}
      modifiedDate={new Date()}
    />

    <Container>
      <Breadcrumb>
        <BreadcrumbItem>
          <a href="/">Home</a>
        </BreadcrumbItem>
        <BreadcrumbItem>
          <MobileView>
            <a href="/">...</a>
          </MobileView>
          <BrowserView>
            <a href="/">Resources</a>
          </BrowserView>
        </BreadcrumbItem>
        <BreadcrumbItem>
          <a href="/cape-papers">CAPE</a>
        </BreadcrumbItem>
        <BreadcrumbItem active>Computer Science</BreadcrumbItem>
      </Breadcrumb>

      <ResourcesLayout>
        <Card>
          <CardBody>
            <CardTitle>CAPE Computer Science Past Papers</CardTitle>
            <br />

            <PDFFile
              title="CSEC Spanish Past Papers"
              href="https://dl.dropbox.com/s/h76ga6bxhdeex94/CSEC%C2%AE%20Spanish%20Past%20Papers-2_nodrm%20%281%29.pdf?dl=0"
            />
            <br />
            <br />
            <PDFFile
              title="CAPE Spanish Past Papers"
              href="https://dl.dropbox.com/s/bjz288n93t2kein/CAPE%20Spanish%20Past%20Papers.pdf?dl=0"
            />

            <br />
            <br />

            <Button href="/past-papers">All Past Papers &rarr;</Button>
          </CardBody>
        </Card>
      </ResourcesLayout>
    </Container>
  </Layout>
);

export default ComputerScience;
